"DT_Output_3" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", t2."P_4" AS "P_4", t2."P_5" AS "P_5", t2."P_6" AS "P_6", t2."P_7" AS "P_7", t2."P_8" AS "P_8", t2."P_9" AS "P_9", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_3" AS t1
   LEFT OUTER JOIN
   "DT_node_data_3" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_4" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_5", t1."Leaf_6", t1."Leaf_21", t1."Leaf_22", t1."Leaf_24", t1."Leaf_26", t1."Leaf_29", t1."Leaf_31", t1."Leaf_32", t1."Leaf_34", t1."Leaf_35", t1."Leaf_37", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40", t1."Leaf_41", t1."Leaf_42", t1."Leaf_45", t1."Leaf_46", t1."Leaf_47", t1."Leaf_48", t1."Leaf_49", t1."Leaf_51", t1."Leaf_52", t1."Leaf_53", t1."Leaf_54", t1."Leaf_55", t1."Leaf_56", t1."Leaf_57", t1."Leaf_58" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_46" > 4.500000) AND (t."X_18" <= 3.500000) AND (t."X_59" <= 15.500000)) THEN 5 ELSE NULL END AS "Leaf_5",
      CASE WHEN((t."X_46" > 4.500000) AND (t."X_18" <= 3.500000) AND (t."X_59" > 15.500000)) THEN 6 ELSE NULL END AS "Leaf_6",
      CASE WHEN((t."X_46" > 4.500000) AND (t."X_18" > 3.500000) AND (t."X_58" > 3.500000) AND (t."X_51" > 9.500000) AND (t."X_54" <= 6.000000)) THEN 21 ELSE NULL END AS "Leaf_21",
      CASE WHEN((t."X_46" > 4.500000) AND (t."X_18" > 3.500000) AND (t."X_58" > 3.500000) AND (t."X_51" > 9.500000) AND (t."X_54" > 6.000000)) THEN 22 ELSE NULL END AS "Leaf_22",
